import React, { Component } from "react";
import { foodCategories } from "./CategoriesList";

export default class Categories extends Component {
  render() {
    const { id } = this.props.categories;
    return (
      <div className="py-5">
        <div className="container">
          <h1>Categories</h1>
          <ul>
            <div className="row">
              <div className="card" />
              <li>Breakfast</li>
              <li>Lunch</li>
              <li>Supper</li>
            </div>
            <div className="row">
              <li>Drinks</li>
              <li>Party</li>
              <li>Snacks</li>
            </div>
          </ul>
        </div>
      </div>
    );
  }
}
